import React from 'react';
import './PartnersMenu.css';
import PartnerItem from '../components/PartnerItem';

const PartnersMenu = () => {
  const partners = [
    {
      id: 1,
      name: 'Молочные продукты',
      description: 'Мы закупаем молоко у лучших фермеров в регионе. Наши поставщики гарантируют высокое качество и свежесть продукции.',
      types: ['Коровье молоко', 'Козье молоко', 'Органическое молоко'],
      image: 'path/to/milk.jpg' // Укажите путь к изображению
    },
    {
      id: 2,
      name: 'Зерна',
      description: 'Наши зерна поставляются из лучших ферм, обеспечивая богатый и насыщенный вкус.',
      types: ['Арабика', 'Робуста', 'Бленды'],
      image: 'path/to/grains.jpg' // Укажите путь к изображению
    },
    {
      id: 3,
      name: 'Сахар',
      description: 'Мы используем только высококачественный сахар от проверенных поставщиков.',
      types: ['Белый сахар', 'Коричневый сахар', 'Тростниковый сахар'],
      image: 'path/to/sugar.jpg' // Укажите путь к изображению
    }
  ];

  return (
    <div className="partners-menu">
      <h2>Наши Партнеры</h2>
      <div className="quality-section">
        <h3>Качество</h3>
        <p>Мы строго следим за качеством всех наших продуктов, чтобы обеспечить нашим клиентам лучший опыт. Наша продукция проходит тщательный контроль на всех этапах производства.</p>
      </div>
      <div className="partners-list">
        {partners.map(partner => (
          <PartnerItem key={partner.id} partner={partner} />
        ))}
      </div>
    </div>
  );
}

export default PartnersMenu;
